'use strict';
var table;
addPageScript(function(){

    $(".js-example-basic-single").select2({ allowClear: true });
    
    $(".js-example-basic-single").select2({ placeholder:' --Select Merchant-- ', allowClear: true });


    empTable = exportDataTable('customer-transaction-table');

    var start = moment().subtract(0, 'days');
	var end = moment();

	$('#reportrange').daterangepicker({
		startDate: start,
		endDate: end,
		ranges: {
		   'Today': [moment(), moment()],
		   'Yesterday': [moment().subtract(1, 'days'), moment().subtract(1, 'days')],
		   'Last 7 Days': [moment().subtract(6, 'days'), moment()],
		   'Last 30 Days': [moment().subtract(29, 'days'), moment()],
		   'This Month': [moment().startOf('month'), moment().endOf('month')],
		   'Last Month': [moment().subtract(1, 'month').startOf('month'), moment().subtract(1, 'month').endOf('month')]
		}
	}, cb);

	cb(start, end);
    
});


function cb(start, end) {
		$('#reportrange span').html(start.format('YYYY-MM-DD') + ' - ' + end.format('YYYY-MM-DD'));
		getCustomerTransReport();
		getCustomerTransByMerchant();
}

function getCustomerTransReport(){
	    var cId = $('#customerId').val();
	    if(cId == undefined || cId == ""){
	    	cId = $('#cId').val()
	    }
	    var dateRange = $('#reportrange span').html();
	    if(cId != undefined && cId != "" && dateRange != undefined && dateRange != ""){
	     	  var dateArr = dateRange.split(" - ");
	     	  if(dateArr.length >= 1){
	     	  	   var fromDate = dateArr[0];
	     	  	   var toDate = dateArr[1];
	     	  	   var response = $.ajax({type: 'POST', url: basepath+"/customer/transactionHistory/data/"+cId, data: {toDate : toDate, fromDate : fromDate},   async: false}).responseText;
				   if(response != undefined){   
					    $(".customerTransactionList").html(response);

				        if(table != undefined){
				        	 table.destroy();
				        }
					    exportDataTable('customer-transaction-table');
	     	        }
	     	    }
	     	 
	     }
}

function redirectToTransDetail(transactionId, id){
    var url = basepath+"/customer/transaction/detail/"+id+"/"+transactionId;
    location.href = url;
}

function getCustomerTransByMerchant(){
    var cId = $('#customerId').val();
    var mId = $('#mId').val();
    if(cId == undefined || cId == ""){
    	cId = $('#cId').val()
    }
    var dateRange = $('#reportrange span').html();
    if(cId != undefined && cId != "" && mId != undefined && mId != "" && dateRange != undefined && dateRange != ""){
     	  var dateArr = dateRange.split(" - ");
     	  if(dateArr.length >= 1){
     	  	   var fromDate = dateArr[0];
     	  	   var toDate = dateArr[1];
     	  	   var response = $.ajax({type: 'POST', url: basepath+"/customer/transactionHistory/tranHistoryBymId?cId="+cId+"&mId="+mId, data: {toDate : toDate, fromDate : fromDate},   async: false}).responseText;
			   if(response != undefined){   
				    $(".customerTransactionList").html(response);

			        if(table != undefined){
			        	 table.destroy();
			        }
				    exportDataTable('customer-transaction-table');
     	        }
     	    }
     	 
     }
}